class Solution(object):
    def findSubstring(self, s, words):
        """
        :type s: str
        :type words: List[str]
        :rtype: List[int]
        """
        if len(words) < 1:
            return []

        res = []

        word_length = len(words[0])
        mem = [[]] * word_length
        for i in range(len(s) - word_length * len(words) + 1):
            if len(mem[i % word_length]) == 0:
                word_set = [e for e in words]
                path = 0
            else:
                word_set = mem[i%word_length][1:]
                path = mem[i%word_length][0]
            while len(word_set) > 0:
                tmp = s[i + path * word_length: i + word_length * (path + 1)]
                if tmp in word_set:
                    path += 1
                    word_set.remove(tmp)
                else:

                    break
            if path > 0:
                word_set.append(s[i: i + word_length])
                mem[i % word_length] = [path - 1] + word_set
            if path == len(words):
                res.append(i)
        return res


